			case 1908:
			case 1960:
			case 1961:
			case 1962:
			case 1963:
			case 1964:
			case 2133:
			case 2016:
			case 2017:
			case 2018:
			case 2019:
			case 2020:
			case 2128:
			case 2129:
			case 2131:
			case 2132:
			case 2072:
			case 2073:
			case 2074:
			case 2075:
			case 2076:
			case 620:
			case 903:
			case 847:

				flg = true;
				break;
			default:
